        "privacyPolicy":
            MessageLookupByLibrary.simpleMessage("ကိုယ်ရေးအချက်အလက်မူဝါဒ"),
        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "ဗီယက်နမ်ဥပဒေအရ၊ အမည်များ၊ အီးမေးလ်လိပ်စာများ၊ စကားဝှက်များနှင့် မွေးသက္ကရာဇ်ကဲ့သို့သော သုံးစွဲသူများ၏ အချက်အလက်များကို “ကိုယ်ရေးကိုယ်တာအချက်အလက်” အဖြစ် ခွဲခြားနိုင်သည်။\n\n အထူးသဖြင့်,\n (က) အမိန့် 72/2013 အရ အမည်၊ အသက်၊ လိပ်စာ၊ လူများ၏ သက်သေခံကတ်ပြားနံပါတ်၊ တယ်လီဖုန်းနံပတ်၊ အီးမေးလ်လိပ်စာနှင့် အခြားအချက်အလက်များ အပါအဝင် လူတစ်ဦးချင်းစီ၏ အထောက်အထားနှင့် ကိုယ်ရေးကိုယ်တာအသေးစိတ်အချက်အလက်များကို ပူးတွဲပါရှိသော အချက်အလက်အဖြစ် သတ်မှတ်ထားသည်။ ဥပဒေအရ သတ်မှတ်သည့်အတိုင်း\n\n (ခ) Circular 25/2010 အရ၊ ကိုယ်ရေးကိုယ်တာအချက်အလက်ဆိုသည်မှာ အောက်ပါအသေးစိတ်အချက်များအနက်မှ အနည်းဆုံးတစ်ခုပါဝင်သည့် လူတစ်ဦးတစ်ယောက်အား တိကျစွာသိရှိနိုင်စေရန် လုံလောက်သောအချက်အလက်များဖြစ်သည်- အမည်အပြည့်အစုံ၊ မွေးသက္ကရာဇ်၊ အလုပ်အကိုင်၊ ခေါင်းစဉ်၊ ဆက်သွယ်ရန်လိပ်စာ၊ အီးမေးလ်လိပ်စာ၊ ဖုန်းနံပါတ်၊ အထောက်အထား ကတ်နံပါတ်နှင့် နိုင်ငံကူးလက်မှတ်နံပါတ်။ ကိုယ်ရေးကိုယ်တာကိုယ်ရေးကိုယ်တာအချက်အလက်တွင် ကျန်းမာရေးမှတ်တမ်း၊ အခွန်ပေးဆောင်မှုမှတ်တမ်း၊ လူမှုအာမခံကတ်နံပါတ်၊ ခရက်ဒစ်ကတ်နံပါတ်နှင့် အခြားကိုယ်ရေးကိုယ်တာလျှို့ဝှက်ချက်များ ပါဝင်သည်။\n\n Circular 25 သည် ဗီယက်နမ်အစိုးရအာဏာပိုင်များမှ လုပ်ဆောင်သည့် ဝဘ်ဆိုက်များမှ ကိုယ်ရေးကိုယ်တာအချက်အလက်များကို စုဆောင်းအသုံးပြုခြင်းနှင့် သက်ဆိုင်ပါသည်။ Circular 25 သည် အစိုးရမဟုတ်သော အဖွဲ့အစည်းများမှ လုပ်ဆောင်သည့် ဝဘ်ဆိုက်များမှ ကိုယ်ရေးကိုယ်တာအချက်အလက်များ စုဆောင်းခြင်းနှင့် အသုံးပြုခြင်းနှင့် တိုက်ရိုက်သက်ဆိုင်ခြင်း မရှိပါ။ သို့ရာတွင်၊ Circular 25 ပါ ပြဋ္ဌာန်းချက်များကို ယှဉ်တွဲ၍ ကျင့်သုံးနိုင်သည်။ ထို့အပြင်၊ အစိုးရမဟုတ်သောအဖွဲ့အစည်းသည် အစိုးရအဖွဲ့အစည်းတစ်ခုအတွက် သက်ဆိုင်သည့်စံနှုန်းများထက် တူညီသော သို့မဟုတ် ပိုမိုတင်းကြပ်သောစံနှုန်းများကို လိုက်နာနိုင်ဖွယ်ရှိသည်။"),
